// App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Box,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  CssBaseline,
  ThemeProvider,
  createTheme,
} from '@mui/material';
import {
  Dashboard as DashboardIcon,
  Phone,
  Queue,
  People,
  Assessment,
} from '@mui/icons-material';
import Dashboard from './components/Dashboard';
import Calls from './pages/Calls';
// Importar otros componentes cuando estén listos
// import Queues from './pages/Queues';
// import Agents from './pages/Agents';

const drawerWidth = 240;

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

const menuItems = [
  { text: 'Dashboard', icon: <DashboardIcon />, path: '/' },
  { text: 'Llamadas', icon: <Phone />, path: '/calls' },
  { text: 'Colas', icon: <Queue />, path: '/queues' },
  { text: 'Agentes', icon: <People />, path: '/agents' },
  { text: 'Reportes', icon: <Assessment />, path: '/reports' },
];

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Router>
        <Box sx={{ display: 'flex' }}>
          <CssBaseline />

          {/* AppBar */}
          <AppBar
            position="fixed"
            sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}
          >
            <Toolbar>
              <Typography variant="h6" noWrap component="div">
                Call Center Analytics - Issabel
              </Typography>
            </Toolbar>
          </AppBar>

          {/* Sidebar */}
          <Drawer
            variant="permanent"
            sx={{
              width: drawerWidth,
              flexShrink: 0,
              '& .MuiDrawer-paper': {
                width: drawerWidth,
                boxSizing: 'border-box',
              },
            }}
          >
            <Toolbar />
            <Box sx={{ overflow: 'auto' }}>
              <List>
                {menuItems.map((item) => (
                  <ListItem
                    button
                    key={item.text}
                    component={Link}
                    to={item.path}
                  >
                    <ListItemIcon>{item.icon}</ListItemIcon>
                    <ListItemText primary={item.text} />
                  </ListItem>
                ))}
              </List>
            </Box>
          </Drawer>

          {/* Main Content */}
          <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
            <Toolbar />
            <Routes>
              <Route path="/" element={<Dashboard />} />
              <Route path="/calls" element={<Calls />} />
              <Route path="/queues" element={<ComingSoon name="Colas" />} />
              <Route path="/agents" element={<ComingSoon name="Agentes" />} />
              <Route path="/reports" element={<ComingSoon name="Reportes" />} />
            </Routes>
          </Box>
        </Box>
      </Router>
    </ThemeProvider>
  );
}

// Componente temporal para páginas en desarrollo
const ComingSoon = ({ name }) => (
  <Box sx={{ textAlign: 'center', mt: 10 }}>
    <Typography variant="h4" gutterBottom>
      {name}
    </Typography>
    <Typography variant="body1" color="text.secondary">
      Esta sección estará disponible próximamente
    </Typography>
  </Box>
);

export default App;
